import React, { useState } from 'react';
import Navbar from '../navSection/Navbar';
import SearchBar from '../component/SearchBar';
import SearchOutlinedIcon from '@mui/icons-material/SearchOutlined';
import Button from 'react-bootstrap/Button';

function Product() {
  const [searchOpen, setSearchOpen] = useState(false);

  const handleSearchOpen = () => {
    setSearchOpen(!searchOpen);
  };
  return (
    <div style={{ position: 'relative' }}>
      <Navbar />
      {!searchOpen && (
        <div
          onClick={handleSearchOpen}
          style={{ position: 'absolute', top: 0, left: '60%' }}
        >
          {' '}
          <Button
            variant="success"
            className="bg-success"
            style={{ height: '35px' }}
          >
            <SearchOutlinedIcon className="text-white" />
          </Button>
        </div>
      )}
      <div
       className="my- m-auto d-none d-md-block"
       style={{ width: '30%', position: 'absolute', top: 0, left: '30%' }}
     >
       <SearchBar />
     </div>
{searchOpen && (
     <div className="">
     
     <div
       className="d-flex bg-success border  d-md-none"
       style={{
         width: '100%',
         height: '35px',
         position: 'absolute',
         top: 0,
         left: 0,
       }}
     >
       <SearchBar />
       <Button
         variant="success"
         className="bg-success"
         style={{ height: '32px' }}
       >
         <SearchOutlinedIcon className="text-white" />
       </Button>
     </div>
    
   </div>
)}
     
    </div>
  );
}

export default Product;
